-- Konversi raw [ ] -> Vector3
-- =====================
local trackData = {}
for i,t in ipairs(rawTrackData) do
    if t.name ~= "AUTO SUMMIT" then
        local fixed = t.raw:gsub("%[","{"):gsub("%]","}")
        local func = loadstring("return {"..fixed.."}")
        if func then
            local ok, tbl = pcall(func)
            if ok and tbl then
                local points = {}
                for j,p in ipairs(tbl) do
                    points[j] = Vector3.new(p[1],p[2],p[3])
                end
                table.insert(trackData,{name=t.name,points=points})
            end
        end
    else
        table.insert(trackData,{name=t.name,points={}})
    end
end

-- =====================
-- Smooth Move
-- =====================
local running = false
local speed = 50

local function getHRP()
    local char = player.Character or player.CharacterAdded:Wait()
    return char:WaitForChild("HumanoidRootPart")
end

local function playTrack(track)
    if not track or #track < 2 then return end
    local hrp = getHRP()
    for i = 1, #track - 1 do
        if not running then break end
        local startPos, endPos = track[i], track[i+1]

        -- Hitung arah hadap
        local direction = (endPos - startPos).Unit
        local lookCFrame = CFrame.new(endPos, endPos + direction)

        local distance = (endPos - startPos).Magnitude
        local duration = distance / speed

        local tween = TweenService:Create(hrp, TweenInfo.new(duration, Enum.EasingStyle.Linear), {
            CFrame = lookCFrame
        })
        tween:Play()
        tween.Completed:Wait()
    end
end

